INSERT INTO `app_article_article` VALUES (1, 'RabbitMQ在Python中的使用详解', '关于python的队列，内置的有两种，一种是线程queue，另一种是进程queue，但是这两种queue都是只能在同一个进程下的线程间或者父进程与子进程之间进行队列通讯，并不能进行程序与程序之间的信息交换，这时候我们就需要一个中间件，来实现程序之间的通讯。', '@[toc]\n# RabbitMQ\n\n> 关于python的队列，内置的有两种，一种是线程queue，另一种是进程queue，但是这两种queue都是只能在同一个进程下的线程间或者父进程与子进程之间进行队列通讯，并不能进行程序与程序之间的信息交换，这时候我们就需要一个中间件，来实现程序之间的通讯。\n\n> Mac安装RabbitMQ ???  https://blog.csdn.net/Coxhuang/article/details/89765797\n\n> Python队列Queue使用 ???  https://blog.csdn.net/Coxhuang/article/details/89764188\n\n## #0 GitHub\n\nhttps://github.com/Coxhuang/python-rabbitmq\n\n\n## #1 环境\n\n```\nPython3.7.3\npika==1.0.1 # pika的版本不同,提供方法的参数名有变化\n```\n\n## #2 开始\n\n### #2.1 轮询模式\n\n> 此模式下，发送队列的一方把消息存入mq的指定队列后，若有消费者端联入相应队列，即会获取到消息，并且队列中的消息会被消费掉。\n若有多个消费端同时连接着队列，则会已轮询的方式将队列中的消息消费掉。\n\n> 生产者\n\n```python\nimport pika\ncredentials = pika.PlainCredentials(\n    username = \'guest\',\n    password = \'guest\',\n)\nconnection = pika.BlockingConnection(\n    pika.ConnectionParameters(\n        host = \'127.0.0.1\', # MQ地址(本机)\n        port = 5672, # 端口号,注意是5672,不是15672\n        virtual_host = \'/\', # 虚拟主机\n        credentials = credentials, # 用户名/密码\n    )\n)\nchannel = connection.channel()\nchannel.queue_declare(\n    queue=\'queue_name_test\', # 队列名\n    durable=True, # 使队列持久化\n)\nchannel.basic_publish(\n    exchange=\'\',\n    routing_key=\'queue_name_test\', # 告诉rabbitmq将消息发送到 queue_name_test 队列中\n    body=\'Hello RabbitMQ!\', # 发送消息的内容\n    properties=pika.BasicProperties( delivery_mode=2,) # 消息持久化\n)\nprint(\"发送...\")\nconnection.close()\n\n```\n\n> 消费者\n\n```python\nimport pika\nimport time\n\nauth = pika.PlainCredentials(\n    username=\'guest\',\n    password=\'guest\',\n) # 用户名 / 密码\nconnection = pika.BlockingConnection(\n    pika.ConnectionParameters(\n        \'127.0.0.1\', # RabbitMQ 地址\n        5672, # 端口号\n        \'/\', # 虚拟主机\n        auth, # 验证\n    )\n) # 链接RabbitMQ\nchannel = connection.channel() # 创建RabbitMQ通道\n\nchannel.queue_declare(\n    queue=\'queue_name_test\', # 消费对列名\n    durable=True, # 持久化\n)\n\n\ndef callback(ch, method, properties, body):\n    print(\"消费者:  %r\" % body)\n\nchannel.basic_consume(\n    queue=\'queue_name_test\', # 对列名\n    auto_ack=True, # 自动回应\n    on_message_callback=callback, # 回调消息\n)\ntime.sleep(5) # 模拟消费时间\nprint(\"消费者\")\nchannel.start_consuming()\n\n```\n\n**运行生产者**\n\n![20190502222720-image.png](https://imgconvert.csdnimg.cn/aHR0cHM6Ly9yYXcuZ2l0aHVidXNlcmNvbnRlbnQuY29tL0NveGh1YW5nL3lvc29yby9tYXN0ZXIvMjAxOTA1MDIyMjI3MjAtaW1hZ2UucG5n?x-oss-process=image/format,png)\n\n---\n\n![20190502225315-image.png](https://imgconvert.csdnimg.cn/aHR0cHM6Ly9yYXcuZ2l0aHVidXNlcmNvbnRlbnQuY29tL0NveGh1YW5nL3lvc29yby9tYXN0ZXIvMjAxOTA1MDIyMjUzMTUtaW1hZ2UucG5n?x-oss-process=image/format,png)\n\n\n\n#### # 模拟轮询模式\n\n\n> 生产者生产5个任务到队列中\n\n```python\nimport pika\ncredentials = pika.PlainCredentials(\n    username = \'guest\',\n    password = \'guest\',\n)\nconnection = pika.BlockingConnection(\n    pika.ConnectionParameters(\n        host = \'127.0.0.1\', # MQ地址(本机)\n        port = 5672, # 端口号,注意是5672,不是15672\n        virtual_host = \'/\', # 虚拟主机\n        credentials = credentials, # 用户名/密码\n    )\n)\n\nchannel = connection.channel()\n\nchannel.queue_declare(\n    queue=\'queue_name_test\', # 队列名\n    durable=True, # 使队列持久化\n)\n\nchannel.basic_publish(\n    exchange=\'\',\n    routing_key=\'queue_name_test\', # 告诉rabbitmq将消息发送到 queue_name_test 队列中\n    body=\"Hello RabbitMQ, I\'m first task \", # 发送消息的内容\n    properties=pika.BasicProperties( delivery_mode=2,) # 消息持久化\n)\n\nchannel.basic_publish(\n    exchange=\'\',\n    routing_key=\'queue_name_test\', # 告诉rabbitmq将消息发送到 queue_name_test 队列中\n    body=\"Hello RabbitMQ, I\'m second task \", # 发送消息的内容\n    properties=pika.BasicProperties( delivery_mode=2,) # 消息持久化\n)\n\nchannel.basic_publish(\n    exchange=\'\',\n    routing_key=\'queue_name_test\', # 告诉rabbitmq将消息发送到 queue_name_test 队列中\n    body=\"Hello RabbitMQ, I\'m third task \", # 发送消息的内容\n    properties=pika.BasicProperties( delivery_mode=2,) # 消息持久化\n)\n\nchannel.basic_publish(\n    exchange=\'\',\n    routing_key=\'queue_name_test\', # 告诉rabbitmq将消息发送到 queue_name_test 队列中\n    body=\"Hello RabbitMQ, I\'m fourth task \", # 发送消息的内容\n    properties=pika.BasicProperties( delivery_mode=2,) # 消息持久化\n)\n\nchannel.basic_publish(\n    exchange=\'\',\n    routing_key=\'queue_name_test\', # 告诉rabbitmq将消息发送到 queue_name_test 队列中\n    body=\"Hello RabbitMQ, I\'m fifth task \", # 发送消息的内容\n    properties=pika.BasicProperties( delivery_mode=2,) # 消息持久化\n)\n\nprint(\"派送任务到队列中...\")\nconnection.close()\n```\n\n> 消费者(新建3个消费者py文件,分别运行消费者程序)\n\n\n```python\n# 消费者1\nimport pika\nimport time\n\nauth = pika.PlainCredentials(\n    username=\'guest\',\n    password=\'guest\',\n) # 用户名 / 密码\nconnection = pika.BlockingConnection(\n    pika.ConnectionParameters(\n        \'127.0.0.1\', # RabbitMQ 地址\n        5672, # 端口号\n        \'/\', # 虚拟主机\n        auth, # 验证\n    )\n) # 链接RabbitMQ\nchannel = connection.channel() # 创建RabbitMQ通道\n\nchannel.queue_declare(\n    queue=\'queue_name_test\', # 消费对列名\n    durable=True, # 持久化\n)\n\n\ndef callback(ch, method, properties, body):\n    print(\"消费者:  %r\" % body)\n    time.sleep(5) # 模拟消费时间\n\nchannel.basic_consume(\n    queue=\'queue_name_test\', # 对列名\n    auto_ack=True, # 自动回应\n    on_message_callback=callback, # 回调消息\n)\n\nprint(\"我是消费者1\")\nchannel.start_consuming()\n\n```\n\n```python\n# 消费者2 \n... # 同消费者1 \n... # 同消费者1 \ndef callback(ch, method, properties, body):\n    print(\"消费者:  %r\" % body)\n    time.sleep(5) # 模拟消费时间\n```\n```python\n# 消费者3 \n... # 同消费者1 \n... # 同消费者1 \ndef callback(ch, method, properties, body):\n    print(\"消费者:  %r\" % body)\n    time.sleep(5) # 模拟消费时间\n```\n\n![20190503110939-image.png](https://imgconvert.csdnimg.cn/aHR0cHM6Ly9yYXcuZ2l0aHVidXNlcmNvbnRlbnQuY29tL0NveGh1YW5nL3lvc29yby9tYXN0ZXIvMjAxOTA1MDMxMTA5MzktaW1hZ2UucG5n?x-oss-process=image/format,png)\n\n---\n\n![20190503111007-image.png](https://imgconvert.csdnimg.cn/aHR0cHM6Ly9yYXcuZ2l0aHVidXNlcmNvbnRlbnQuY29tL0NveGh1YW5nL3lvc29yby9tYXN0ZXIvMjAxOTA1MDMxMTEwMDctaW1hZ2UucG5n?x-oss-process=image/format,png)\n\n---\n\n![20190503111014-image.png](https://imgconvert.csdnimg.cn/aHR0cHM6Ly9yYXcuZ2l0aHVidXNlcmNvbnRlbnQuY29tL0NveGh1YW5nL3lvc29yby9tYXN0ZXIvMjAxOTA1MDMxMTEwMTQtaW1hZ2UucG5n?x-oss-process=image/format,png)\n\n---\n\n![20190503111019-image.png](https://imgconvert.csdnimg.cn/aHR0cHM6Ly9yYXcuZ2l0aHVidXNlcmNvbnRlbnQuY29tL0NveGh1YW5nL3lvc29yby9tYXN0ZXIvMjAxOTA1MDMxMTEwMTktaW1hZ2UucG5n?x-oss-process=image/format,png)\n\n---\n\n> 轮询模式:公平分配任务给消费者,不考虑消费者的消费能力\n\n\n### #2.2 广播模式\n\n> 在多consumer的情况下，默认rabbitmq是轮询发送消息的，但有的consumer消费速度快，有的消费速度慢，为了资源使用更平衡，引入ack确认机制。consumer消费完消息后会给rabbit发送ack，一旦未ack的消息数量超过指定允许的数量，则不再往该consumer发送，改为发送给其他consumer。\n\n#### # 模拟广播模式\n\n- 生产者代码不变\n\n- 消费者\n\n```python\n# 插入如下代码\n...\ndef callback(ch, method, properties, body):\n    print(\"消费者2:  %r\" % body)\n    time.sleep(10) # 模拟消费者消费能力\n    ch.basic_ack(delivery_tag=method.delivery_tag)\n\nchannel.basic_qos(prefetch_count=1)\n...\n```\n\n> 消费者1消费能力: 1秒一个\n\n> 消费者2消费能力: 10秒一个\n\n> 消费者3消费能力: 15秒一个\n\n---\n\n![20190503114152-image.png](https://imgconvert.csdnimg.cn/aHR0cHM6Ly9yYXcuZ2l0aHVidXNlcmNvbnRlbnQuY29tL0NveGh1YW5nL3lvc29yby9tYXN0ZXIvMjAxOTA1MDMxMTQxNTItaW1hZ2UucG5n?x-oss-process=image/format,png)\n\n---\n\n![20190503124102-image.png](https://imgconvert.csdnimg.cn/aHR0cHM6Ly9yYXcuZ2l0aHVidXNlcmNvbnRlbnQuY29tL0NveGh1YW5nL3lvc29yby9tYXN0ZXIvMjAxOTA1MDMxMjQxMDItaW1hZ2UucG5n?x-oss-process=image/format,png)\n\n---\n\n![20190503124133-image.png](https://imgconvert.csdnimg.cn/aHR0cHM6Ly9yYXcuZ2l0aHVidXNlcmNvbnRlbnQuY29tL0NveGh1YW5nL3lvc29yby9tYXN0ZXIvMjAxOTA1MDMxMjQxMzMtaW1hZ2UucG5n?x-oss-process=image/format,png)\n\n\n\n\n\n\n\n---\n\n\n## # 报错\n\n### #1 \n\n```\n# error\npika.exceptions.AMQPConnectionError\n```\n```\n# RabbitMQ地址写错\n```\n\n### #2 \n\n\n```\n# error\nTypeError: basic_consume() got multiple values for argument \n```\n\n\n```\npika版本不同\n当前pika==1.0.1\nbasic_consume的参数名发生改变,应该为如下格式:\nchannel.basic_consume(\n    queue=\'queue_name_test\', # 对列名\n    auto_ack=False, # 自动回应\n    on_message_callback=callback, # 回调消息\n)\n```', 41, '2019-12-24 21:58:00.429613', '2019-12-25 21:55:15.391184', 1, '', 0, '[\"RabbitMQ\",\"Queue\",\"Python\"]', '{}', 1);
INSERT INTO `app_article_article` VALUES (2, 'Django  Celery4 异步任务配置和使用', 'Celery 需要消息中间件来进行发送和接收消息。 RabbitMQ 和 Redis 中间人的功能比较齐全，但也支持其它的实验性的解决方案，其中包括 SQLite 进行本地开发。', '@[toc]\n# Celery4 异步任务\n\n?? **celery定时任务请看下面这篇博客**\n\n?? https://blog.csdn.net/Coxhuang/article/details/89058429\n\n\n\n## #0 GitHub\n\nhttps://github.com/Coxhuang/django-celery4\n\n\n\n\n\n## #1 环境\n\n```python\nPython3.7\ncelery==4.3.0\ndjango==2.0.7\nredis==3.2.1 # 低版本的redis不兼容celery\n```\n\n\n## #2 项目配置\n\n- 新建Django项目\n- 配置和celery的定时任务一致(Django配置请看这里?? https://blog.csdn.net/Coxhuang/article/details/89058429)\n\n\n## #3 需求分析\n\n- 用户在\"找回密码\"功能中,点击发送邮件,会发送相应的数据到指定邮箱\n- 发送邮箱需要比较长的时间处理\n- django 原生为单线程序，当第一个请求没有完成时，第二个请求辉阻塞，知道第一个请求完成，第二个请求才会执行。\n- 不希望用户界面长时间存于等待邮箱发送中的状态\n\n\n## #4 开始\n\n### #4.1 开一个发送邮箱接口\n\n视图函数\n\n```python\nfrom django.shortcuts import render,HttpResponse\nfrom app.tasks import send_email\ndef email_api(request):\n    send_email.delay() # 发送邮件(异步)\n    return HttpResponse(\"邮件发送成功 !!! \")\n```\n\ntasks.py\n\n```python\n@shared_task\ndef send_email():\n    print(\"邮件发送中...\")\n    sleep(5) # 模拟发送邮件消耗的时间\n    xxx.objects.create(\n        name=\"发送邮件\",\n    ) # 把记录加到数据库中,(凭个人爱好,可加可不加)\n    return \"邮箱发送成功\"\n```\n\n在app下__init__.py文件\n\n```\nfrom __future__ import absolute_import\n\n# This will make sure the app is always imported when\n# Django starts so that shared_task will use this app.\nfrom .celery import app as celery_app\n\n__all__ = [\'celery_app\']\n```\n### #4.2 测试\n\n- 访问接口\n\n![20190502165925-image.png](https://imgconvert.csdnimg.cn/aHR0cHM6Ly9yYXcuZ2l0aHVidXNlcmNvbnRlbnQuY29tL0NveGh1YW5nL3lvc29yby9tYXN0ZXIvMjAxOTA1MDIxNjU5MjUtaW1hZ2UucG5n?x-oss-process=image/format,png)\n\n\n- 打开worker\n\n```\ncelery multi start worker1 -A celery4\n```\n\n![20190502171147-image.png](https://imgconvert.csdnimg.cn/aHR0cHM6Ly9yYXcuZ2l0aHVidXNlcmNvbnRlbnQuY29tL0NveGh1YW5nL3lvc29yby9tYXN0ZXIvMjAxOTA1MDIxNzExNDctaW1hZ2UucG5n?x-oss-process=image/format,png)\n\n\n---\n\n![20190502171241-image.png](https://imgconvert.csdnimg.cn/aHR0cHM6Ly9yYXcuZ2l0aHVidXNlcmNvbnRlbnQuY29tL0NveGh1YW5nL3lvc29yby9tYXN0ZXIvMjAxOTA1MDIxNzEyNDEtaW1hZ2UucG5n?x-oss-process=image/format,png)\n\n---\n\n![20190502171338-image.png](https://imgconvert.csdnimg.cn/aHR0cHM6Ly9yYXcuZ2l0aHVidXNlcmNvbnRlbnQuY29tL0NveGh1YW5nL3lvc29yby9tYXN0ZXIvMjAxOTA1MDIxNzEzMzgtaW1hZ2UucG5n?x-oss-process=image/format,png)\n\n\n## 注意事项\n\n### #1 在app下的__init__.py必须加上那些代码,否则不会成功\n\n\n\n---\n---', 1, '2019-12-25 21:27:20.189187', '2019-12-25 21:29:06.228129', 1, '', 0, '[\"Celery\",\"异步\",\"Python\",\"任务\"]', '{}', 1);
INSERT INTO `app_article_article` VALUES (3, 'Python爬虫Scrapy爬西刺代理网站匿名ip', '爬取ip代理网站免费的ip,把不能用的ip过滤掉', '@[toc]\n# 代理池ip爬取\n\n\n\n## #0 GitHub\n\n```\nhttps://github.com/Coxhuang/scrapy_proxy\n```\n\n## #1 环境\n\n```\nPython3.7.3\nScrapy==1.6.0\n```\n\n## #2 需求\n\n- 爬取ip代理网站免费的ip\n- 把不能用的ip过滤掉\n- 目标站点 https://www.xicidaili.com/nt/\n\n\n## #3 准备\n\n### #3.1 新建一个scrapy项目\n\n```\nscrapy startproject proxy_ips\n```\n\n```\n.\n└── proxy_ips\n    ├── proxy_ips\n    │   ├── __init__.py\n    │   ├── items.py\n    │   ├── middlewares.py\n    │   ├── pipelines.py\n    │   ├── settings.py\n    │   └── spiders\n    │       ├── __init__.py\n    └── scrapy.cfg\n```\n\n### #3.2 新建爬虫(在spiders目录下)\n\n```\nscrapy genspider ips \"xicidaili.com\"\n```\n\n## #4 开始\n\n### #4.1 测试目标站点反爬机制\n\n- 裸跑\n\n\n```\n# -*- coding: utf-8 -*-\nimport scrapy\nclass IpsSpider(scrapy.Spider):\n    name = \'ips\'\n    allowed_domains = [\'xicidaili.com\']\n    start_urls = (\n        \'https://www.xicidaili.com/nt/\',\n    )\n    def parse(self, response):\n        print(response.xpath(\'//*[@id=\"ip_list\"]/tbody/tr[2]/td[2]\').extract())\n```\n\n```\nscrapy crawl ips --nolog\n```\n\n\n> 没有拿到数据\n\n![20190429133316-image.png](https://imgconvert.csdnimg.cn/aHR0cHM6Ly9yYXcuZ2l0aHVidXNlcmNvbnRlbnQuY29tL0NveGh1YW5nL3lvc29yby9tYXN0ZXIvMjAxOTA0MjkxMzMzMTYtaW1hZ2UucG5n?x-oss-process=image/format,png)\n\n\n- 加User-Agent\n\n\nsettings.py\n\n```\nMY_USER_AGENT = [\n    \"Mozilla/4.0 (compatible; MSIE 6.0; Windows NT 5.1; SV1; AcooBrowser; .NET CLR 1.1.4322; .NET CLR 2.0.50727)\",\n    \"Mozilla/4.0 (compatible; MSIE 7.0; Windows NT 6.0; Acoo Browser; SLCC1; .NET CLR 2.0.50727; Media Center PC 5.0; .NET CLR 3.0.04506)\",\n    \"Mozilla/4.0 (compatible; MSIE 7.0; AOL 9.5; AOLBuild 4337.35; Windows NT 5.1; .NET CLR 1.1.4322; .NET CLR 2.0.50727)\",\n    \"Mozilla/5.0 (Windows; U; MSIE 9.0; Windows NT 9.0; en-US)\",\n    \"Mozilla/5.0 (compatible; MSIE 9.0; Windows NT 6.1; Win64; x64; Trident/5.0; .NET CLR 3.5.30729; .NET CLR 3.0.30729; .NET CLR 2.0.50727; Media Center PC 6.0)\",\n    \"Mozilla/5.0 (compatible; MSIE 8.0; Windows NT 6.0; Trident/4.0; WOW64; Trident/4.0; SLCC2; .NET CLR 2.0.50727; .NET CLR 3.5.30729; .NET CLR 3.0.30729; .NET CLR 1.0.3705; .NET CLR 1.1.4322)\",\n    \"Mozilla/4.0 (compatible; MSIE 7.0b; Windows NT 5.2; .NET CLR 1.1.4322; .NET CLR 2.0.50727; InfoPath.2; .NET CLR 3.0.04506.30)\",\n    \"Mozilla/5.0 (Windows; U; Windows NT 5.1; zh-CN) AppleWebKit/523.15 (KHTML, like Gecko, Safari/419.3) Arora/0.3 (Change: 287 c9dfb30)\",\n    \"Mozilla/5.0 (X11; U; Linux; en-US) AppleWebKit/527+ (KHTML, like Gecko, Safari/419.3) Arora/0.6\",\n    \"Mozilla/5.0 (Windows; U; Windows NT 5.1; en-US; rv:1.8.1.2pre) Gecko/20070215 K-Ninja/2.1.1\",\n    \"Mozilla/5.0 (Windows; U; Windows NT 5.1; zh-CN; rv:1.9) Gecko/20080705 Firefox/3.0 Kapiko/3.0\",\n    \"Mozilla/5.0 (X11; Linux i686; U;) Gecko/20070322 Kazehakase/0.4.5\",\n    \"Mozilla/5.0 (X11; U; Linux i686; en-US; rv:1.9.0.8) Gecko Fedora/1.9.0.8-1.fc10 Kazehakase/0.5.6\",\n    \"Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/535.11 (KHTML, like Gecko) Chrome/17.0.963.56 Safari/535.11\",\n    \"Mozilla/5.0 (Macintosh; Intel Mac OS X 10_7_3) AppleWebKit/535.20 (KHTML, like Gecko) Chrome/19.0.1036.7 Safari/535.20\",\n    \"Opera/9.80 (Macintosh; Intel Mac OS X 10.6.8; U; fr) Presto/2.9.168 Version/11.52\",\n    \"Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/536.11 (KHTML, like Gecko) Chrome/20.0.1132.11 TaoBrowser/2.0 Safari/536.11\",\n    \"Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.1 (KHTML, like Gecko) Chrome/21.0.1180.71 Safari/537.1 LBBROWSER\",\n    \"Mozilla/5.0 (compatible; MSIE 9.0; Windows NT 6.1; WOW64; Trident/5.0; SLCC2; .NET CLR 2.0.50727; .NET CLR 3.5.30729; .NET CLR 3.0.30729; Media Center PC 6.0; .NET4.0C; .NET4.0E; LBBROWSER)\",\n    \"Mozilla/4.0 (compatible; MSIE 6.0; Windows NT 5.1; SV1; QQDownload 732; .NET4.0C; .NET4.0E; LBBROWSER)\",\n    \"Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/535.11 (KHTML, like Gecko) Chrome/17.0.963.84 Safari/535.11 LBBROWSER\",\n    \"Mozilla/4.0 (compatible; MSIE 7.0; Windows NT 6.1; WOW64; Trident/5.0; SLCC2; .NET CLR 2.0.50727; .NET CLR 3.5.30729; .NET CLR 3.0.30729; Media Center PC 6.0; .NET4.0C; .NET4.0E)\",\n    \"Mozilla/5.0 (compatible; MSIE 9.0; Windows NT 6.1; WOW64; Trident/5.0; SLCC2; .NET CLR 2.0.50727; .NET CLR 3.5.30729; .NET CLR 3.0.30729; Media Center PC 6.0; .NET4.0C; .NET4.0E; QQBrowser/7.0.3698.400)\",\n    \"Mozilla/4.0 (compatible; MSIE 6.0; Windows NT 5.1; SV1; QQDownload 732; .NET4.0C; .NET4.0E)\",\n    \"Mozilla/4.0 (compatible; MSIE 7.0; Windows NT 5.1; Trident/4.0; SV1; QQDownload 732; .NET4.0C; .NET4.0E; 360SE)\",\n    \"Mozilla/4.0 (compatible; MSIE 6.0; Windows NT 5.1; SV1; QQDownload 732; .NET4.0C; .NET4.0E)\",\n    \"Mozilla/4.0 (compatible; MSIE 7.0; Windows NT 6.1; WOW64; Trident/5.0; SLCC2; .NET CLR 2.0.50727; .NET CLR 3.5.30729; .NET CLR 3.0.30729; Media Center PC 6.0; .NET4.0C; .NET4.0E)\",\n    \"Mozilla/5.0 (Windows NT 5.1) AppleWebKit/537.1 (KHTML, like Gecko) Chrome/21.0.1180.89 Safari/537.1\",\n    \"Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.1 (KHTML, like Gecko) Chrome/21.0.1180.89 Safari/537.1\",\n    \"Mozilla/5.0 (iPad; U; CPU OS 4_2_1 like Mac OS X; zh-cn) AppleWebKit/533.17.9 (KHTML, like Gecko) Version/5.0.2 Mobile/8C148 Safari/6533.18.5\",\n    \"Mozilla/5.0 (Windows NT 6.1; Win64; x64; rv:2.0b13pre) Gecko/20110307 Firefox/4.0b13pre\",\n    \"Mozilla/5.0 (X11; Ubuntu; Linux x86_64; rv:16.0) Gecko/20100101 Firefox/16.0\",\n    \"Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.11 (KHTML, like Gecko) Chrome/23.0.1271.64 Safari/537.11\",\n    \"Mozilla/5.0 (X11; U; Linux x86_64; zh-CN; rv:1.9.2.10) Gecko/20100922 Ubuntu/10.10 (maverick) Firefox/3.6.10\",\n    \"Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/58.0.3029.110 Safari/537.36\",\n    ]\n```\n\n\n```\nDOWNLOADER_MIDDLEWARES = {\n   # \'proxy_ips.middlewares.ProxyIpsDownloaderMiddleware\': 543,\n    \'scrapy.downloadermiddleware.useragent.UserAgentMiddleware\': None,\n    \'proxy_ips.middlewares.MyUserAgentMiddleware\': 400,\n}\n```\n\nmiddlewares.py\n\n\n```\nimport random\nfrom scrapy.downloadermiddlewares.useragent import UserAgentMiddleware\n\nclass MyUserAgentMiddleware(UserAgentMiddleware):\n    \'\'\'\n    设置User-Agent\n    \'\'\'\n\n    def __init__(self, user_agent):\n        self.user_agent = user_agent\n\n    @classmethod\n    def from_crawler(cls, crawler):\n        return cls(\n            user_agent=crawler.settings.get(\'MY_USER_AGENT\')\n        )\n\n    def process_request(self, request, spider):\n        agent = random.choice(self.user_agent)\n        request.headers[\'User-Agent\'] = agent\n\n```\n\nips.py\n\n```\ndef parse(self, response):\n    print(response.xpath(\'/html/head/title/text()\').extract_first())\n    print(response.xpath(\'//*[@id=\"ip_list\"]/tbody/tr[6]/td[2]/text()\').extract_first())\n```\n\n![20190430175647-image.png](https://imgconvert.csdnimg.cn/aHR0cHM6Ly9yYXcuZ2l0aHVidXNlcmNvbnRlbnQuY29tL0NveGh1YW5nL3lvc29yby9tYXN0ZXIvMjAxOTA0MzAxNzU2NDctaW1hZ2UucG5n?x-oss-process=image/format,png)\n\n\n> 通过xpath能获取网页的数据,但是就是拿不到tbody表格里面的数据 ?\n\n\n\n- 在xpath时,把tbody去掉\n\n\n```\ndef parse(self, response):\n    print(response.xpath(\'/html/head/title/text()\').extract_first())\n    print(response.xpath(\'//*[@id=\"ip_list\"]/tr[6]/td[2]/text()\').extract_first())\n```\n![20190429162502-image.png](https://imgconvert.csdnimg.cn/aHR0cHM6Ly9yYXcuZ2l0aHVidXNlcmNvbnRlbnQuY29tL0NveGh1YW5nL3lvc29yby9tYXN0ZXIvMjAxOTA0MjkxNjI1MDItaW1hZ2UucG5n?x-oss-process=image/format,png)\n\n\n\n### #4.2 获取下一页数据\n\n> 分页url分析\n\n\n```\nhttps://www.xicidaili.com/nn/1\nhttps://www.xicidaili.com/nn/2\n...\n\n```\n\n\n```\ndef parse(self, response):\n    for page in range(1, 3): # 获取1-2页数据\n        url_next = \"https://www.xicidaili.com/nn/{}/\".format(page)\n        yield scrapy.Request(url_next, callback=self.parse_response_next)\n```\n\n![20190430192308-image.png](https://imgconvert.csdnimg.cn/aHR0cHM6Ly9yYXcuZ2l0aHVidXNlcmNvbnRlbnQuY29tL0NveGh1YW5nL3lvc29yby9tYXN0ZXIvMjAxOTA0MzAxOTIzMDgtaW1hZ2UucG5n?x-oss-process=image/format,png)\n\n\n\n```\ndef parse_response_next(self,response):\n\n    for tr_line in response.xpath(\'//*[@id=\"ip_list\"]/tr\'):\n        ip = tr_line.xpath(\'td[2]/text()\').extract_first()\n        port = tr_line.xpath(\'td[3]/text()\').extract_first()\n        http = str(ip) + \":\" + str(port)\n        print(http)\n    return None\n```\n\n![20190430192659-image.png](https://imgconvert.csdnimg.cn/aHR0cHM6Ly9yYXcuZ2l0aHVidXNlcmNvbnRlbnQuY29tL0NveGh1YW5nL3lvc29yby9tYXN0ZXIvMjAxOTA0MzAxOTI2NTktaW1hZ2UucG5n?x-oss-process=image/format,png)\n\n\n> 测试ip是否可用\n\n```\ndef __check_ip(self,http):\n    \"\"\"\n    测试ip可用性\n    :param http: ip:port\n    :return: None\n    \"\"\"\n    proxies = {\n        \"http\": \"http://{}\".format(http),\n        \"https\": \"http://{}\".format(http),\n    }\n    try:\n        response = requests.get(\n            url,\n            headers=headers,\n            proxies=proxies,\n            timeout=5, # 请求超时时间超过5秒,认为该ip用不了\n        )\n        if int(response.status_code) == 200:\n            print(http)\n            return True\n    except:\n        pass\n\n    return False\n```\n\n![20190430195907-image.png](https://imgconvert.csdnimg.cn/aHR0cHM6Ly9yYXcuZ2l0aHVidXNlcmNvbnRlbnQuY29tL0NveGh1YW5nL3lvc29yby9tYXN0ZXIvMjAxOTA0MzAxOTU5MDctaW1hZ2UucG5n?x-oss-process=image/format,png)\n\n> 把可用的ip写入数据库(这里用MongoDB)\n\n**一定要确保MongoDB可以正常使用**\n\nitems.py\n\n```\nimport scrapy\nclass ProxyIpsItem(scrapy.Item):\n    http = scrapy.Field()\n    ip = scrapy.Field()\n    port = scrapy.Field()\n    is_active = scrapy.Field()\n    check_time = scrapy.Field()\n```\n\n\n\npipelines.py\n\n\n```\nimport pymongo\nclass ProxyIpsPipeline(object):\n    \n    def __init__(self):\n        host = \"127.0.0.1\" # MongoDB地址\n        port = 27017 # 端口号\n        dbName = \"proxy\" # 数据库名\n        client = pymongo.MongoClient(host=host, port=port)\n        tdb = client[dbName]\n        self.post = tdb[\"proxytable\"] # 表名\n\n    def process_item(self, item, spider):\n        bookInfo = dict(item)\n        self.post.insert(bookInfo)\n        return item\n```\n\nips.py\n\n```\ndef parse_response_next(self,response):\n\n    for tr_line in response.xpath(\'//*[@id=\"ip_list\"]/tr\'):\n\n        ip = tr_line.xpath(\'td[2]/text()\').extract_first()\n        port = tr_line.xpath(\'td[3]/text()\').extract_first()\n        http = str(ip) + \":\" + str(port)\n        ret = self.__check_ip(http=http)\n        if ret:\n            item = ProxyIpsItem()\n            item[\"http\"] = http\n            item[\"ip\"] = str(ip)\n            item[\"port\"] = str(port)\n            item[\"is_active\"] = True\n            item[\"check_time\"] = datetime.now()\n\n            yield item\n```\n\nsettings.py\n\n```\nITEM_PIPELINES = {\n   \'proxy_ips.pipelines.ProxyIpsPipeline\': 300,\n}\n```\n\n\n![20190430214641-image.png](https://imgconvert.csdnimg.cn/aHR0cHM6Ly9yYXcuZ2l0aHVidXNlcmNvbnRlbnQuY29tL0NveGh1YW5nL3lvc29yby9tYXN0ZXIvMjAxOTA0MzAyMTQ2NDEtaW1hZ2UucG5n?x-oss-process=image/format,png)', 0, '2019-12-25 21:30:15.659319', '2019-12-25 21:31:10.233949', 1, '', 0, '[\"Scrapy\",\"爬虫\",\"代理\",\"Python\"]', '{}', 1);
INSERT INTO `app_article_article` VALUES (4, 'Nginx+uWSGI为Django提供高并发', 'Nginx+uWSGI为Django提供高并发', '@[toc]\n# Nginx+uwsgi部署Django\n\n## #0 GitHub\n\n```\nNone\n```\n\n## #1 环境\n\n```\nCentOS6.9 ( 腾讯云服务器 )\nPython 3.6.4\nDjango==2.0.7\n```\n\n## #2 开始\n\n### #2.1 新建一个Django项目\n> 项目根目录(把django项目放在opt目录下)\n\n```\n/opt/pro\n```\n\n\n### #2.2 项目结构\n\n>工程名:pro\n> \n>app名:app\n\n```\n.\n├── app\n│   ├── __init__.py\n│   ├── admin.py\n│   ├── apps.py\n│   ├── migrations\n│   ├── models.py\n│   ├── tests.py\n│   └── views.py\n├── manage.py\n├── pro\n│   ├── __init__.py\n│   ├── settings.py\n│   ├── urls.py\n│   └── wsgi.py\n└── templates\n```\n\n### #2.3 修改settings.py\n> 因为不涉及到数据库,所以把数据库配置删掉\n\n```\n#DATABASES = {\n#     \'default\': {\n#         \'ENGINE\': \'django.db.backends.sqlite3\',\n#         \'NAME\': os.path.join(BASE_DIR, \'db.sqlite3\'),\n#     }\n# }\n```\n> 允许所有url访问\n\n```\nALLOWED_HOSTS = [\"*\"]\n```\n\n## #3 uwsgi\n\n### #3.1 安装uwsgi\n\n```\npip3 install uwsgi\n```\n\n### #3.2 使用uwsgi启动django项目\n\n> 安装django\n\n```\npip3 install django==2.0.7\n```\n\n> 进入项目根目录(/opt/pro)\n\n```\ncd /opt/pro/ \nuwsgi --http 0.0.0.0:8080 --file pro/wsgi.py --static-map=/static=static\n\n```\n\n> 解释上述命令\n```\n--http 0.0.0.0:8080 # 指定ip,因为我用的是云服务器,所以是0.0.0.0,如果用的是虚拟机,把0.0.0.0改成虚拟机内网ip(猜测,没有实践过)\n--file pro/wsgi.py # 指定django项目中wsgi.py文件\n--static-map=/static=static # 静态文件\n```\n\n### #3.3 使用uwsgi配置文件启动django项目(重点)\n\n> 在项目根目录下新建文件夹 script\n\n```\ncd /opt/pro/ \nmkdir script\n```\n\n> 在script目录下新建 uwsgi.ini\n\n```\ncd script\nvim uwsgi.ini\n```\n\n> 填入以下内容\n\n```\n# uwsig使用配置文件启动                                                                                                    \n[uwsgi]                                                                                                                    \n# 项目目录                                                                                                                 \nchdir=/opt/pro/                                                                                                            \n# 指定项目的application                                                                                                    \nmodule=pro.wsgi:application                                                                                                \n# 指定sock的文件路径                                                                                                       \nsocket=/opt/pro/script/uwsgi.sock                                                                                          \n# 进程个数                                                                                                                 \nworkers=5                                                                                                                  \npidfile=/opt/pro/script/uwsgi.pid                                                                                          \n# 指定IP端口 云服务器需要改成 0.0.0.0                                                                                      \nhttp=0.0.0.0:8080                                                                                                          \n# 指定静态文件                                                                                                             \nstatic-map=/static=/opt/pro/pro/static                                                                                     \n# 启动uwsgi的用户名和用户组                                                                                                \nuid=root                                                                                                                   \ngid=root                                                                                                                   \n# 启用主进程                                                                                                               \nmaster=true                                                                                                                \n# 自动移除unix Socket和pid文件当服务停止的时候                                                                             \nvacuum=true                                                                                                                \n# 序列化接受的内容，如果可能的话                                                                                           \nthunder-lock=true                                                                                                          \n# 启用线程                                                                                                                 \nenable-threads=true                                                                                                        \n# 设置自中断时间                                                                                                           \nharakiri=30                                                                                                                \n# 设置缓冲                                                                                                                 \npost-buffering=4096                                                                                                        \n# 设置日志目录                                                                                                             \ndaemonize=/opt/pro/script/uwsgi.log \n```\n\n> 启动uwsgi\n\n```\ncd /opt/pro/script/ \nuwsgi --ini uwsgi.ini # 启动uwsgi\n```\n\n> uwsgi相关操作\n\n```\nuwsgi --ini uwsgi.ini # 启动\nuwsgi --stop uwsgi.pid # 关闭\n```\n\n## #4 Nginx\n\n### #4.1 安装Nginx\n> 配置yum源\n\n```\nvim /etc/yum.repos.d/nginx.repo\n```\n\n\n```\n[nginx]\nname=nginx repo\n# 下面这行centos根据你自己的操作系统修改比如：OS/rehel\n# 6是你Linux系统的版本，可以通过URL查看路径是否正确\nbaseurl=http://nginx.org/packages/centos/6/\\$basearch/\ngpgcheck=0\nenabled=1\n```\n> 安装nginx\n\n```\nyum -y install nginx\n```\n\n> 测试是否安装完成，命令启动nginx\n\n```\n/etc/init.d/nginx start\n```\n\n\n### #4.2 Django + Uwsgi + Nginx\n\n> 创建配置文件\n\n```\ncd /etc/nginx/conf.d/\nvim pro.conf\n```\n\n\n```\nserver {                                                                                                               \n        listen 80;                                            \n        server_name 192.144.190.22; # 如果服务器已经被域名解析,必须填域名                        \n        access_log  /var/log/nginx/access.log  main;                                                           \n        charset  utf-8;                                                 \n        gzip on;                                              \n        gzip_types text/plain application/x-javascript text/css text/javascript application/x-httpd-php application/json text/json image/jpeg image/gif image/png application/octet-stream;                          \n        error_page  404           /404.html;                                                                   \n        error_page   500 502 503 504  /50x.html;          \n        # 指定项目路径uwsgi                                      \n        location / {                                            \n            include uwsgi_params;                  \n            uwsgi_connect_timeout 30;                               \n            uwsgi_pass unix:/opt/pro/script/uwsgi.sock;              \n        }                                                        \n        # 指定静态文件路径                                       \n        location /static/ {                                    \n            alias  /opt/pro/pro/static/;                                            \n            index  index.html index.htm;                               \n        }   \n    }\n         \n```\n\n> 完美 !!!!!!!!\n\n> Nginx相关命令\n\n```\n/etc/init.d/nginx start # 开始\n/etc/init.d/nginx stop # 关闭\n/etc/init.d/nginx restart # 重启\n```\n\n## #5 注意\n- 用Nginx+uwsgi部署django,必须Nginx和uwsgi都启动\n\n## #6 番外篇\n### #1 uWSGI\n\n#### # 启动django\n\n```\n# file : Django项目中wsgi.py文件路径\nuwsgi --http 0.0.0.0:8000 --file Demo/wsgi.py\n```\n\n#### # uWSGI参数\n\n\n参数 | 说明\n---|---\nhttp | 地址和端口号，例如：uwsgi --http 0.0.0.0:8000 \nsocket | 地址和端口号，例如：uwsgi --socket :8001 \nlisten | 设置socket的监听队列大小（默认：100）\nprocesses | 开启的进程数量\nworkers | 开启的进程数量，等同于processes\nthreads | 运行线程(processes的线程数)\nmaster | 允许主进程存在,启动主进程，来管理其他进程，其它的uwsgi进程都是这个master进程的子进程，如果kill这个master进程，相当于重启所有的uwsgi进程。\ndaemonize | 使进程在后台运行，并将日志打到指定的日志文件或者udp服务器（daemonize uWSGI）。实际上最常用的，还是把运行记录输出到一个本地文件上。\nlog-maxsize | 以固定的文件大小（单位KB），切割日志文件\npidfile |  指定pid文件的位置，记录主进程的pid号。\nchdir | 指定运行目录\nwsgi-file | 载入wsgi-file\nstats | 在指定的地址上，开启状态服务\nvacuum | 当服务器退出的时候自动清理环境，删除unix socket文件和pid文件\ndisable-logging | 不记录请求信息的日志。只记录错误以及uWSGI内部消息到日志中。如果不开启这项，那么你的日志中会大量出现这种记录\n\n- http 和 socket 的区别\n\n> http : nginx 和 uwsgi 中间走的是 http 协议，文本\n\n> socket : nginx 和 uwsgi 中间走的是 wsgi 协议，二进制\n\n> 生产环境百分之九十九是 unix Socket 的方式，ngnix 是做反向代理用的，因为 uwsgi 不具备路由、过滤等方向代理功能，但论执行效率，可以做性能测试，如果是 http 协议的话，性能是没有 unix Socket 方式好的\n\n\n#### # uWSGI 加进程启动Django\n\n\n```\n# 添加4个进程,每个进程2个线程\n\nuwsgi --http 0.0.0.0:8000 --file Demo/wsgi.py --processes 4 --threads 2\n```\n\n### #2 Nginx\n\n****未完待续...****\n\n\n\n---\n\n---', 0, '2019-12-25 21:31:48.235535', '2019-12-25 21:45:18.435131', 1, '', 0, '[]', '{}', 1);
INSERT INTO `app_article_article` VALUES (5, 'Django google-authenticator Google令牌', '登录时,使用二次动态验证,可以有效防止密码泄露带来的一些列问题,这里使用Google提供的验证工具,提高用户的安全性', '@[toc]\n# Google令牌\n\n## #0 github\n\n```\nhttps://github.com/Coxhuang/google-authenticator.git\n```\n\n## #1 使用操作\n\n- 调用绑定google-authenticator的接口,生成一个二维码(如何生成先不用管,后面再说)\n- 手机客户端扫描二维码,App生成一个动态的6位验证码\n- 输入验证码,返回True/False\n\n\n\n\n## #2 原理\n\nGoogle令牌分成两部分,一部分是服务端(Google提供的开源代码),另一部分就是客户端(用户在手机/电脑上安装的app或者插件)\n\n\n\n- (服务端)随机生成一个字符串,并将该字符串+用户唯一标示(这里我用的用户唯一标示是邮箱)构造成固定的格式生成一个二维码\n- (客户端)手机下载google-authenticator客户端,扫描二维码,二维码的信息(字符串+用户唯一标示)会保存在客户端内,App通过算法生成一个6位的验证码(验证码会通过时间的变化,30秒更新一次)\n- (服务端)服务端使用Google提供的代码,把App提供的验证码+邮箱进行校验\n\n## #3 实例讲解\n\n### 需求分析\n\n- 用户登陆时,除了需要用户名和密码,还需要提供该用户对应的Google令牌验证码\n\n### 使用步骤\n\n#### 新增用户(跳过这一步骤)\n#### 绑定google-authenticator\n\n调用绑定令牌接口效果图\n![在这里插入图片描述](https://img-blog.csdnimg.cn/20190109153833133.png?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L0NveGh1YW5n,size_16,color_FFFFFF,t_70)\n\n拿返回的数据生成二维码,因为是前后端分离的项目,所以生成二维码交给前端处理,我这里使用网上在线生成二维码工具(https://cli.im/text?3dd4ec76bb965fb69effefc6a95b8ff8)\n![在这里插入图片描述](https://img-blog.csdnimg.cn/20190109153851908.png?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L0NveGh1YW5n,size_16,color_FFFFFF,t_70)\n\n使用手机App扫描二维码\n\n![在这里插入图片描述](https://img-blog.csdnimg.cn/20190109153911841.png?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L0NveGh1YW5n,size_16,color_FFFFFF,t_70)\n\n登陆\n\n输入错误的令牌\n\n![在这里插入图片描述](https://img-blog.csdnimg.cn/20190109153927141.png?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L0NveGh1YW5n,size_16,color_FFFFFF,t_70)\n\n输入正确的令牌,会生成token,也就是登陆成功\n![在这里插入图片描述](https://img-blog.csdnimg.cn/20190109153937543.png?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L0NveGh1YW5n,size_16,color_FFFFFF,t_70)\n\n\n\n## #4 具体代码讲解(本例子是前后端分离项目,只考虑后端,前端代码忽略,后端代码基于Django RestFramework)\n### #4.1 需求分析\n- 在用户登陆时,除了需要用户提供账号密码,还需要用户提供该用户实时的令牌验证码\n- 登陆成功返回TOKEN\n\n### #4.2 绑定令牌\n\n先上代码\n```\nclass googleSerializer(DynamicFieldsMixin,serializers.ModelSerializer):\n    username = serializers.CharField()\n    password = serializers.CharField()\n    class Meta:\n        model = models.UserProfile\n        fields = [\"username\",\"password\",]\n    def validate_username(self, username):\n        user = authenticate(username=username, password=self.initial_data[\"password\"]) # 验证需要绑定令牌的用户账号密码是否[匹配\n        if not user:\n            raise Http404(\"账号密码不匹配\")\n        return username\n\nclass googleBindAPI(APIView):\n    def post(self,request):\n        queryset = models.Google2Auth.objects.filter(Q(user__username=request.data[\"username\"]) | Q(user__email=request.data[\"username\"]))\n        if queryset.exists():\n            return Response({\"success\": False, \"msg\": \"已经绑定令牌,绑定失败\", \"results\": None},status=status.HTTP_400_BAD_REQUEST)\n        serializer = googleSerializer(data=request.data)\n        serializer.is_valid(raise_exception=True)\n        user = models.UserProfile.objects.get(Q(email=request.data[\"username\"]) | Q(username=request.data[\"username\"]))\n        login(request, user)\n        base_32_secret = base64.b32encode(codecs.decode(codecs.encode(\'{0:020x}\'.format(random.getrandbits(80))), \'hex_codec\'))\n        totp_obj = googletotp.TOTP(base_32_secret.decode(\"utf-8\"))\n        qr_code = re.sub(r\'=+$\', \'\', totp_obj.provisioning_uri(request.user.email))\n        models.Google2Auth.objects.create(user=user)\n        key = str(base_32_secret,encoding=\"utf-8\")\n        queryset.update(key=key)\n        return Response({\"success\": True, \"msg\": \"绑定成功\",\"results\": {\"将此数据生成二维码\": qr_code}}, status=status.HTTP_201_CREATED)\n```\n\n请求头数据(用户名+密码)\n\n```\n{\n	\"username\":\"user\",\n	\"password\":\"cox123456\"\n}\n```\n![在这里插入图片描述](https://img-blog.csdnimg.cn/20190109153951444.png)\n\n表结构\n\n```\nclass Google2Auth(models.Model):\n    user = models.OneToOneField(UserProfile,on_delete=models.CASCADE)\n    key = models.CharField(verbose_name=\"Google秘钥\",max_length=128)\n```\n\n\n\n### #4.2 登陆\n\n\n```\nclass loginView(APIView):\n    def post(self,request):\n        user = authenticate(username=request.data[\"username\"], password=request.data[\"password\"])\n        if not user:\n            raise Http404(\"账号密码不匹配\")\n        try:\n            # 判断用户是否已经绑定Google令牌\n            key = models.Google2Auth.objects.get(\n                Q(user__username=request.data[\"username\"])|Q(user__email=request.data[\"username\"])).key\n        except:\n            raise Http404(\"未绑定令牌\")\n        if not Google_Verify_Result(key, request.data[\"code\"]):\n            # 验证令牌\n            return Response({\"success\": True, \"msg\": \"令牌失效\", \"results\": None}, status=status.HTTP_400_BAD_REQUEST)\n        login(request, user)\n        jwt_payload_handler = api_settings.JWT_PAYLOAD_HANDLER\n        jwt_encode_handler = api_settings.JWT_ENCODE_HANDLER\n        payload = jwt_payload_handler(user)\n        token = jwt_encode_handler(payload)\n        return Response({ \"success\": True, \"msg\": \"登录成功\",\"results\": token},status=status.HTTP_200_OK)\n```\n\n## 总结\n\n随机生成的字符串在客户端保存是通过二维码保存,在服务端保存在数据库中,用户在App上拿到的验证码是App中的算法经过随机字符串+时间戳+其他 生成的(这里的随机字符串和时间戳可以理解为盐),然后用户在登录时,经过服务端的算法时,把用户对应的字符串+验证码+本地时间戳,Google提供的算法会返回是否匹配\n\n## App\n- Google令牌+扫码器(如果手机只安装Google令牌App扫码失败,请安装扫码器)\n链接：https://pan.baidu.com/s/1XeO7p4IvNuvzQOiZrq4wtw \n提取码：e70f \n\n- Chrome插件(不需要手机App,用插件就能绑定)\n\n```\nhttps://chrome.google.com/webstore/detail/authenticator/bhghoamapcdpbohphigoooaddinpkbai\n```\n![在这里插入图片描述](https://img-blog.csdnimg.cn/20190109154621529.png?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L0NveGh1YW5n,size_16,color_FFFFFF,t_70)', 0, '2019-12-25 21:45:48.728388', '2019-12-25 21:48:16.905553', 1, '', 0, '[\"Google令牌\",\"二次验证\"]', '{}', 1);
INSERT INTO `app_article_article` VALUES (6, 'Django REST Framework JWT Auth TOKEN', 'JWT验证实现cookie功能', '@[toc]\n# TOKEN\n## 项目文件树形图\n\n![在这里插入图片描述](https://img-blog.csdnimg.cn/20190105183256310.png)\n## 配置\n\n### #1 settings.py\n\n```\nINSTALLED_APPS = [\n    ...\n    \'app\', # app\n    \'rest_framework\', # 使用Django restframework\n    \'rest_framework.authtoken\', #TOKEN 验证\n]\n\n...\nAUTH_USER_MODEL = \'app.UserProfile\' # 因为models使用AbstractUser\nimport datetime\nJWT_AUTH = {\n    \'JWT_EXPIRATION_DELTA\': datetime.timedelta(days=1),# token的有效期\n    \'JWT_ISSUER\': \'http://fasfdas.baicu\',\n    \'JWT_AUTH_HEADER_PREFIX\': \'TOKEN\',\n    \'JWT_ALLOW_REFRESH\': True,\n    \'JWT_REFRESH_EXPIRATION_DELTA\': datetime.timedelta(days=1)\n}\n...\n```\n\n### #2 models.py\n\n```\nfrom django.db import models\nfrom django.contrib.auth.models import AbstractUser\nclass UserProfile(AbstractUser):\n    age = models.IntegerField(verbose_name=\"年龄\",default=\"1\")\n```\n\n### #3 views.py\n\n\n```\nfrom django.shortcuts import render\nfrom rest_framework.views import APIView\nfrom rest_framework.response import Response\nfrom rest_framework import status\nfrom app import models\nfrom django.contrib.auth import login\nfrom rest_framework_jwt.settings import api_settings\nfrom django.contrib.auth import authenticate\nfrom django.shortcuts import Http404\nfrom rest_framework import mixins\nfrom rest_framework.viewsets import GenericViewSet\nfrom rest_framework import serializers\nfrom drf_dynamic_fields import DynamicFieldsMixin\nfrom rest_framework import permissions\nfrom rest_framework_jwt.authentication import JSONWebTokenAuthentication\n\n\n\"\"\"1. 登陆\"\"\"\nclass loginView(APIView):\n    \"\"\"登陆成功后,获取TOKEN\"\"\"\n    def post(self,request):\n        user = authenticate(username=request.data[\"username\"], password=request.data[\"password\"])\n        if not user:\n            raise Http404(\"账号密码不匹配\")\n        login(request, user)\n        jwt_payload_handler = api_settings.JWT_PAYLOAD_HANDLER\n        jwt_encode_handler = api_settings.JWT_ENCODE_HANDLER\n        payload = jwt_payload_handler(user)\n        token = jwt_encode_handler(payload)\n        return Response({ \"success\": True, \"msg\": \"登录成功\",\"results\": token},status=status.HTTP_200_OK)\n\n\n\"\"\"2. 新增玩家\"\"\"\nclass UserSerializer(DynamicFieldsMixin,serializers.ModelSerializer):\n    class Meta:\n        model = models.UserProfile\n        fields = [\"username\",\"password\",]\n    def create(self, validated_data):\n        user= models.UserProfile.objects.create_user(**validated_data) # 这里新增玩家必须用create_user,否则密码不是秘文\n        return user\n\nclass createUser(mixins.CreateModelMixin,GenericViewSet):\n    queryset = models.UserProfile.objects.all()\n    serializer_class = UserSerializer\n\n\n\"\"\"3. 获取用户列表(验证token)\"\"\"\nclass getUser(mixins.ListModelMixin,GenericViewSet):\n    authentication_classes = (JSONWebTokenAuthentication,)\n    permission_classes = (permissions.IsAuthenticatedOrReadOnly,)\n    queryset = models.UserProfile.objects.all()\n    serializer_class = UserSerializer\n\n```\n\n### #4 urls.py\n```\nfrom django.contrib import admin\nfrom django.urls import path,include\nfrom app import views\nfrom rest_framework import routers\nfrom app import views\ncreateUserViewRouter = routers.DefaultRouter() # 新增用户\ncreateUserViewRouter.register(\'\', views.createUser,)\ngetUserRouter = routers.DefaultRouter() # 查看用户列表\ngetUserRouter.register(\'\', views.getUser,)\nurlpatterns = [\n    path(\'admin/\', admin.site.urls),\n    path(\'gettoken/\',views.loginView.as_view()), # 获取 token\n    path(\'createuser/\',include(createUserViewRouter.urls)), # 新增用户\n    path(\'getuser/\',include(getUserRouter.urls)), # 新增用户\n]\n\n```\n\n\n## 获取TOKEN\n### 创建一个用户(调用新增用户接口)\n\n```\nhttp://127.0.0.1:8000/createuser/\n```\n\n![在这里插入图片描述](https://img-blog.csdnimg.cn/20190105182823624.png?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L0NveGh1YW5n,size_16,color_FFFFFF,t_70)\n\n### 登陆用户,获取token\n\n```\nhttp://127.0.0.1:8000/gettoken/\n```\n\n![在这里插入图片描述](https://img-blog.csdnimg.cn/20190105182836835.png?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L0NveGh1YW5n,size_16,color_FFFFFF,t_70)\n\n### 验证token\n\n#### 未加token验证\n\n```\nclass getUser(mixins.ListModelMixin,GenericViewSet):\n    queryset = models.UserProfile.objects.all()\n    serializer_class = UserSerializer\n```\n\n```\nhttp://127.0.0.1:8000/getuser/\n```\n\n![在这里插入图片描述](https://img-blog.csdnimg.cn/20190105182857267.png?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L0NveGh1YW5n,size_16,color_FFFFFF,t_70)\n\n#### 加token验证\n\n\n```\nclass getUser(mixins.ListModelMixin,GenericViewSet):\n    authentication_classes = (JSONWebTokenAuthentication,) # 验证token\n    permission_classes = (permissions.IsAuthenticated,) # 只允许登陆成功的用户访问\n    queryset = models.UserProfile.objects.all()\n    serializer_class = UserSerializer\n```\n```\nhttp://127.0.0.1:8000/getuser/\n```\n\n![在这里插入图片描述](https://img-blog.csdnimg.cn/20190105182920387.png?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L0NveGh1YW5n,size_16,color_FFFFFF,t_70)\n\n## 权限\n\n\n```\npermission_classes = (permissions.AllowAny,) # 所有用户\npermission_classes = (permissions.IsAuthenticated,) # 登陆成功的token\npermission_classes = (permissions.IsAuthenticatedOrReadOnly,) # 登陆成功的token,只能读操作\npermission_classes = (permissions.IsAdminUser,) # 登陆成功的管理员token\n```\n\n\n\n## Github\n\n```\nhttps://github.com/Coxhuang/TOKEN.git\n```\n\n## 官方文档\n\n\n~~http://getblimp.github.io/django-rest-framework-jwt/~~ \n\n新的文档地址:\n\nhttp://jpadilla.github.io/django-rest-framework-jwt/', 3, '2019-12-25 21:48:41.520323', '2019-12-25 23:46:03.718746', 1, '', 0, '[\"JWT\",\"TOKEN\",\"Auth\",\"Django\"]', '{}', 1);
